import React, { useState } from 'react';
import axios from 'axios';

export default function AdminDashboard() {
  const [csvFile, setCsvFile] = useState(null);
  const [form, setForm] = useState({
    student_id: '234567',
    subject: '',
    score: '',
    grade: '',
    term: '2nd Term',
    session: '2024/25',
  });
  const [message, setMessage] = useState('');

  const handleUpload = async () => {
    if (!csvFile) return;
    const formData = new FormData();
    formData.append('file', csvFile);
    await axios.post('http://localhost:5000/api/results/upload', formData);
    alert('Results uploaded!');
  };

  const handleFormChange = (e) => {
    setForm({ ...form, [e.target.name]: e.target.value });
  };

  const handleFormSubmit = async (e) => {
    e.preventDefault();
    try {
      await axios.post('http://localhost:5000/api/results/manual', form);
      setMessage('Result added!');
      setForm({ ...form, subject: '', score: '', grade: '' });
    } catch (err) {
      setMessage('Error adding result');
    }
  };

  return (
    <div className="flex">
      <nav className="w-64 bg-gray-100 min-h-screen p-4">
        <ul>
          <li className="mb-2 font-bold">Add/Edit Students</li>
          <li className="mb-2 font-bold">Upload Result</li>
          <li className="mb-2 font-bold">Manage Subjects</li>
          <li className="mb-2 font-bold">Manage Sessions/Terms</li>
          <li className="mb-2 font-bold">View Result History</li>
          <li className="mb-2 font-bold text-red-500 cursor-pointer" onClick={() => { localStorage.clear(); window.location = '/'; }}>Logout</li>
        </ul>
      </nav>
      <main className="flex-1 p-8">
        <h2 className="text-xl font-bold mb-4">ðŸ“¤ Upload Result for JSS2B - 2nd Term 2024/25</h2>
        <input type="file" accept=".csv" onChange={e => setCsvFile(e.target.files[0])} />
        <button className="bg-blue-500 text-white p-2 rounded ml-2" onClick={handleUpload}>Upload CSV</button>

        {/* Manual Result Entry Form */}
        <div className="mt-8 max-w-md bg-white rounded shadow p-6">
          <h3 className="font-bold mb-2">Add Dummy Result (Manual Entry)</h3>
          <form onSubmit={handleFormSubmit} className="space-y-2">
            <input type="text" name="student_id" value={form.student_id} readOnly className="w-full p-2 border rounded bg-gray-100" />
            <input type="text" name="subject" value={form.subject} onChange={handleFormChange} placeholder="Subject" className="w-full p-2 border rounded" required />
            <input type="number" name="score" value={form.score} onChange={handleFormChange} placeholder="Score" className="w-full p-2 border rounded" required />
            <input type="text" name="grade" value={form.grade} onChange={handleFormChange} placeholder="Grade (A/B/C/D/F)" className="w-full p-2 border rounded" required />
            <input type="text" name="term" value={form.term} onChange={handleFormChange} placeholder="Term" className="w-full p-2 border rounded" />
            <input type="text" name="session" value={form.session} onChange={handleFormChange} placeholder="Session" className="w-full p-2 border rounded" />
            <button type="submit" className="bg-green-500 text-white px-4 py-2 rounded">Add Result</button>
          </form>
          {message && <div className="mt-2 text-sm text-blue-600">{message}</div>}
        </div>
      </main>
    </div>
  );
}
